Allergenicity:
Tests performed using purified recombinant protein and tomato allergic subjects (UNPUBLISHED, PhD thesis): 
In vitro (ELISA) 5 of 6 positive; 
basophil activation, 2 of 9 positive; 
skin prick test 1 of 9 positive.
